	CREATE TABLE CourseSections(
		ID int NOT NULL PRIMARY KEY,
		sCourseID int NULL,
		section tinyint NULL,
		semester tinyint NOT NULL,
		block char(1) NULL,
		year smallint NOT NULL,
		active tinyint NOT NULL,
		courseID int NULL,
		instructorID int NULL,
		urlID int NULL,
		daysOfWeek nvarchar(8) NULL,
		meetingRoom nvarchar(10) NULL,
		meetingTime nvarchar(15) NULL,
		offeredByCode char(2) NULL,
		locationCode char(2) NULL,
		creditHrs real NULL,
		lastStaarsUpdate datetime NULL,
		subjectCode varchar(4) NULL,
		courseNumber varchar(5) NULL,
		startDate datetime NULL,
		endDate datetime NULL,
		campusCode char(3) NULL,
		bannerCRN int NULL,
		vistaLCID bigint NULL,
		vistaName varchar(50) NULL,
		lmsID tinyint NULL
	);
	CREATE NONCLUSTERED INDEX IX_CourseSections_bannerCRN ON CourseSections (bannerCRN);
	CREATE NONCLUSTERED INDEX IX_CourseSections_courseNumber ON CourseSections (courseNumber);
	CREATE NONCLUSTERED INDEX IX_CourseSections_endDate ON CourseSections (endDate);
	CREATE NONCLUSTERED INDEX IX_CourseSections_semester ON CourseSections (semester);
	CREATE NONCLUSTERED INDEX IX_CourseSections_startDate ON CourseSections (startDate);
	CREATE NONCLUSTERED INDEX IX_CourseSections_subjectCode ON CourseSections (subjectCode);
	CREATE NONCLUSTERED INDEX IX_CourseSections_year ON CourseSections (year);
	
